import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import ProductComponents from './ProductComponents';
import axios from 'axios';
import {SetProduct} from '../redux/actions/ProductsAction'
const ProductListing = () => {
     //fectch the product from redux store
    
     const product=useSelector((state)=>state); 
     const dispatch=useDispatch();
     const fetechProducts= async ()=>{
        const req=await axios.get("https://fakestoreapi.com/products").catch((err)=>{
            console.log("Error",err)
        });
        dispatch(SetProduct(req.data))
     }
     console.log(product);
     useEffect (()=>{
      fetechProducts();
     },[])
  return (
   
    <div className='ui grid container'>
      <ProductComponents/>
    </div>
  )
}

export default ProductListing
